Can He Score? - Puma Swede - The Puma Is A Man Eatter

Added: Friday, November 5, 2010  

Length: 36 minutes  

Girls: Puma Swede 

This week is an awesome week for CHS. Puma Swede is in town and she's not fucking around! She wants herself some man-meat and she wants it now. That's why we set her up with George a 19 year old punk who has nothing but the world in his eyes and an insatiable hunger to be spanked by an older woman. Oh man, if you can imagine someone saying all the wrong words and still score. This is the episode that shows you how he did it. Plus, you get to see how bad ass Puma is and how she dominates that young cub or will it be George who turns the tables and shows us that yes HE CAN SCORE?!
